import React from "react";
import styles from "./Cell.module.css"

function Cell(props){
	const perc = 1/props.size;
	return(
		<div className={styles.cell} 
		styles={{width: `${1/props.size}`,height: `${1/props}`}}>
		</div>
	)
}


export default Cell;
